docs/api/ShallowWrapper/contains.html.body:
.contains(nodeOrNodes) => Boolean
Returns whether or not all given react elements match elements in the render tree.
It will determine if an element in the wrapper matches the expected element by checking if the expected element has the same props as the wrapper's element and share the same values.
Arguments

nodeOrNodes (ReactElement|Array): The node or array of nodes whose presence you are detecting in the current instance's
render tree.

Returns
Boolean: whether or not the current wrapper has nodes anywhere in its render tree that match
the ones passed in.
Example
const wrapper = shallow((

    Hello

));

expect(wrapper.contains(Hello)).to.equal(true);

expect(wrapper.contains(Hello)).to.equal(false);
expect(wrapper.contains(Hello)).to.equal(false);
expect(wrapper.contains(Hello)).to.equal(false);
expect(wrapper.contains()).to.equal(false);

const wrapper = shallow((

    Hello
    Goodbye
    Again

));

expect(wrapper.contains([
  Hello,
  Goodbye,
])).to.equal(true);

expect(wrapper.contains([
  Hello,
  World,
])).to.equal(false);

Common Gotchas

.contains() expects a ReactElement, not a selector (like many other methods). Make sure that
when you are calling it you are calling it with a ReactElement or a JSX expression.
Keep in mind that this method determines equality based on the equality of the node's children as
well.

docs/api/ShallowWrapper/containsMatching.body:
.containsMatchingElement(node) => Boolean
Returns whether or not a given react element matches one element in the render tree.
It will determine if an element in the wrapper matches the expected element by checking if all props supplied in the expected element are present on the wrapper's element and equal to each other. Props present on the wrapper element but not supplied in the expected element will be ignored.
Arguments

node (ReactElement): The node whose presence you are detecting in the current instance's
render tree.

Returns
Boolean: whether or not the current wrapper has a node anywhere in its render tree that matches
the one passed in.
Example
const wrapper = shallow((

    Hello

));

expect(wrapper.containsMatchingElement(Hello)).to.equal(true);
expect(wrapper.containsMatchingElement(Hello)).to.equal(true);

expect(wrapper.containsMatchingElement(Hello)).to.equal(false);
expect(wrapper.containsMatchingElement(Hello)).to.equal(false);
expect(wrapper.containsMatchingElement()).to.equal(false);

Common Gotchas

.containsMatchingElement() expects a ReactElement, not a selector (like many other methods). Make sure that
when you are calling it you are calling it with a ReactElement or a JSX expression.
Keep in mind that this method determines equality based on the equality of the node's children as
well.

docs/api/ShallowWrapper/debug.html.body:
.debug() => String
Returns an HTML-like string of the wrapper for debugging purposes. Useful to print out to the
console when tests are not passing when you expect them to.
Returns
String: The resulting string.
Examples
function Book({ title, pages }) {
  return (

      {title}
      {pages && }

  );
}
Book.propTypes = {
  title: PropTypes.string.isRequired,
  pages: PropTypes.number,
};
Book.defaultProps = {
  pages: null,
};

const wrapper = shallow();
console.log(wrapper.debug());

Outputs to console:

 Huckleberry Finn


const wrapper = shallow((

));
console.log(wrapper.debug());

Outputs to console:

 Huckleberry Finn

docs/api/ShallowWrapper/dive.html.body:
.dive([options]) => ShallowWrapper
Shallow render the one non-DOM child of the current wrapper, and return a wrapper around the result.
NOTE: can only be called on wrapper of a single non-DOM component element node.
Arguments

options (Object [optional]):
options.context: (Object [optional]): Context to be passed into the component

Returns
ShallowWrapper: A new wrapper that wraps the current node after it's been shallow rendered.
Examples
function Bar() {
  return (



  );
}

function Foo() {
  return (



  );
}

const wrapper = shallow();
expect(wrapper.find('.in-bar')).to.have.length(0);
expect(wrapper.find(Bar)).to.have.length(1);
expect(wrapper.find(Bar).dive().find('.in-bar')).to.have.length(1);

docs/api/ShallowWrapper/every.html.body:
.every(selector) => Boolean
Returns whether or not all of the nodes in the wrapper match the provided selector.
Arguments

selector (EnzymeSelector): The selector to match.

Returns
Boolean: True if every node in the current wrapper matched the provided selector.
Examples
const wrapper = shallow((





));
expect(wrapper.find('.foo').every('.foo')).to.equal(true);
expect(wrapper.find('.foo').every('.qoo')).to.equal(false);
expect(wrapper.find('.foo').every('.bar')).to.equal(false);

Related Methods

