docs/api/ShallowWrapper/find.html.body:
.find(selector) => ShallowWrapper
Finds every node in the render tree of the current wrapper that matches the provided selector.
Arguments

selector (EnzymeSelector): The selector to match.

Returns
ShallowWrapper: A new wrapper that wraps the found nodes.
Examples
CSS Selectors:
const wrapper = shallow();
expect(wrapper.find('.foo')).to.have.length(1);
expect(wrapper.find('.bar')).to.have.length(3);

// compound selector
expect(wrapper.find('div.some-class')).to.have.length(3);

// CSS id selector
expect(wrapper.find('#foo')).to.have.length(1);

Component Constructors:
import Foo from '../components/Foo';

const wrapper = shallow();
expect(wrapper.find(Foo)).to.have.length(1);

Component Display Name:
const wrapper = shallow();
expect(wrapper.find('Foo')).to.have.length(1);

Object Property Selector:
const wrapper = shallow();
expect(wrapper.find({ prop: 'value' })).to.have.length(1);

Related Methods

.findWhere(predicate) => ShallowWrapper

docs/api/ShallowWrapper/forEach.html.body:
.forEach(fn) => Self
Iterates through each node of the current wrapper and executes the provided function with a
wrapper around the corresponding node passed in as the first argument.
Arguments

fn (Function ( ShallowWrapper node, Number index )): A callback to be run for every node in the collection.
Should expect a ShallowWrapper as the first argument, and will be run with a context of the original
instance.

Returns
ShallowWrapper: Returns itself.
Example
const wrapper = shallow((





));

wrapper.find('.foo').forEach((node) => {
  expect(node.hasClass('foo')).to.equal(true);
});

Related Methods

.map(fn) => ShallowWrapper

