docs/api/ShallowWrapper/instance.html.body:
.instance() => ReactComponent
Gets the instance of the component being rendered as the root node passed into shallow().
NOTE: can only be called on a wrapper instance that is also the root instance.
Returns
ReactComponent: The component instance.
Example
const wrapper = shallow();
const inst = wrapper.instance();
expect(inst).to.be.instanceOf(MyComponent);

docs/api/ShallowWrapper/key.html.body:
.key() => String
Returns the key value for the node of the current wrapper.
NOTE: can only be called on a wrapper of a single node.
Example
const wrapper = shallow((

    {['foo', 'bar'].map(s => {s})}

)).find('li');
expect(wrapper.at(0).key()).to.equal('foo');
expect(wrapper.at(1).key()).to.equal('bar');

docs/api/ShallowWrapper/matchesElement.h.body:
.matchesElement(node) => Boolean
Returns whether or not a given react element matches the shallow render tree.
It will determine if the wrapper root node looks like the expected element by checking if all props of the expected element are present on the wrapper root node and equals to each other.
Arguments

node (ReactElement): The node whose presence you are detecting in the current instance's
render tree.

Returns
Boolean: whether or not the current wrapper match the one passed in.
Example
class MyComponent extends React.Component {
  constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);
  }
  handleClick() {
    // ...
  }
  render() {
    return (
      Hello
    );
  }
}

const wrapper = shallow();
expect(wrapper.matchesElement(Hello)).to.equal(true);
expect(wrapper.matchesElement(Hello)).to.equal(true);

Common Gotchas

.matchesElement() expects a ReactElement, not a selector (like many other methods). Make sure that
when you are calling it you are calling it with a ReactElement or a JSX expression.
Keep in mind that this method determines matching based on the matching of the node's children as
well.

docs/api/ShallowWrapper/name.html.body:
.name() => String|null
Returns the name of the current node of this wrapper. If it's a composite component, this will be
the name of the top-most rendered component. If it's native DOM node, it will be a string of the
tag name. If it's null, it will be null.
The order of precedence on returning the name is: type.displayName -> type.name -> type.
Note: can only be called on a wrapper of a single node.
Returns
String|null: The name of the current node
Examples
const wrapper = shallow();
expect(wrapper.name()).to.equal('div');

function SomeWrappingComponent() {
  return ;
}
const wrapper = shallow();
expect(wrapper.name()).to.equal('Foo');

Foo.displayName = 'A cool custom name';
function SomeWrappingComponent() {
  return ;
}
const wrapper = shallow();
expect(wrapper.name()).to.equal('A cool custom name');

docs/api/ShallowWrapper/prop.html.body:
.prop(key) => Any
Returns the prop value for the root node of the wrapper with the provided key.
.prop(key) can only be called on a wrapper of a single node.
NOTE: When called on a shallow wrapper, .prop(key) will return values for
props on the root node that the component renders, not the component itself.
To return the props for the entire React component, use wrapper.instance().props.
See .instance() => ReactComponent
Arguments

key (String): The prop name such that this will return value will be the this.props[key]
of the root node of the component.

Example
import PropTypes from 'prop-types';

function MyComponent({ includedProp }) {
  return (
    Hello
  );
}
MyComponent.propTypes = {
  includedProp: PropTypes.string.isRequired,
};

const wrapper = shallow();
expect(wrapper.prop('includedProp')).to.equal('Success!');

// Warning: .prop(key) only returns values for props that exist in the root node.
// See the note above about wrapper.instance().props to return all props in the React component.

console.log(wrapper.prop('includedProp'));
// "Success!"

console.log(wrapper.prop('excludedProp'));
// undefined

console.log(wrapper.instance().props.excludedProp);
// "I'm not included"

Related Methods

.props() => Object
.state([key]) => Any
.context([key]) => Any

docs/api/ShallowWrapper/props.html.body:
.props() => Object
Returns the props hash for the root node of the wrapper. .props() can only be
called on a wrapper of a single node.
NOTE: When called on a shallow wrapper, .props() will return values for
props on the root node that the component renders, not the component itself.
To return the props for the entire React component, use wrapper.instance().props.
See .instance() => ReactComponent
Example
import PropTypes from 'prop-types';

function MyComponent(props) {
  const { includedProp } = props;
  return (
    Hello
  );
}
MyComponent.propTypes = {
  includedProp: PropTypes.string.isRequired,
};

const wrapper = shallow();
expect(wrapper.props().includedProp).to.equal('Success!');

// Warning: .props() only returns props that are passed to the root node,
// which does not include excludedProp in this example.
// See the note above about wrapper.instance().props.

console.log(wrapper.props());
// {children: "Hello", className: "foo bar", includedProp="Success!"}

console.log(wrapper.instance().props);
// {children: "Hello", className: "foo bar", includedProp:"Success!", excludedProp: "I'm not included"}

Related Methods

.prop(key) => Any
.state([key]) => Any
.context([key]) => Any

docs/api/ShallowWrapper/reduce.html.body:
.reduce(fn[, initialValue]) => Any
Applies the provided reducing function to every node in the wrapper to reduce to a single value.
Each node is passed in as a ShallowWrapper, and is processed from left to right.
Arguments

fn (Function): A reducing function to be run for every node in the collection, with the
following arguments:

value (T): The value returned by the previous invocation of this function
node (ShallowWrapper): A wrapper around the current node being processed
index (Number): The index of the current node being processed


initialValue (T [optional]): If provided, this will be passed in as the first argument to the first invocation of the reducing function. If omitted, the first node will be provided and the iteration will begin on the second node in the collection.


Returns
T: Returns an array of the returned values from the mapping function...
Example
function Foo() {
  return (





  );
}

const wrapper = shallow();
const total = wrapper.find(Bar).reduce((amount, n) => amount + n.prop('amount'));
expect(total).to.equal(16);

Related Methods

.reduceRight(fn[, initialValue]) => Any
.forEach(fn) => ShallowWrapper
.map(fn) => Array

