docs/api/ShallowWrapper/setContext.html.body:
.setContext(context) => Self
A method that sets the context of the root component, and re-renders. Useful for when you are
wanting to test how the component behaves over time with changing contexts.
NOTE: can only be called on a wrapper instance that is also the root instance.
Arguments

context (Object): An object containing new props to merge in with the current state

Returns
ShallowWrapper: Returns itself.
Example
import PropTypes from 'prop-types';

function SimpleComponent(props, context) {
  const { name } = context;
  return {name};
}
SimpleComponent.contextTypes = {
  name: PropTypes.string,
};

const context = { name: 'foo' };
const wrapper = shallow(, { context });
expect(wrapper.text()).to.equal('foo');
wrapper.setContext({ name: 'bar' });
expect(wrapper.text()).to.equal('bar');
wrapper.setContext({ name: 'baz' });
expect(wrapper.text()).to.equal('baz');

Common Gotchas

.setContext() can only be used on a wrapper that was initially created with a call to shallow()
that includes a context specified in the options argument.
The root component you are rendering must have a contextTypes static property.

Related Methods

.setState(state) => Self
.setProps(props) => Self

docs/api/ShallowWrapper/setProps.html.body:
.setProps(props) => Self
A method that sets the props of the root component, and re-renders. Useful for when you are
wanting to test how the component behaves over time with changing props. Calling this, for
instance, will call the componentWillReceiveProps lifecycle method.
Similar to setState, this method accepts a props object and will merge it in with the already
existing props.
NOTE: can only be called on a wrapper instance that is also the root instance.
Arguments

props (Object): An object containing new props to merge in with the current state

Returns
ShallowWrapper: Returns itself.
Example
import PropTypes from 'prop-types';

function Foo({ name }) {
  return (

  );
}
Foo.propTypes = {
  name: PropTypes.string.isRequired,
};

const wrapper = shallow();
expect(wrapper.find('.foo')).to.have.length(1);
